  serializeChkValues:function(id_list) {
  var strvals='';
  id_list +=',';
  var aEl=id_list.split(",");
  for(var i=0;i<aEl.length;i++){
    if(aEl[i]!=''){
      var e=null;
      e=document.getElementById(aEl[i]);
      if(e!=null){
        if(e.checked){
          strvals +=e.value+',';
        }
      }
    }
  }
return(strvals.slice(0,strvals.length-1));
}

